VALUES ('3512690002198', 'Penne Bolognaise', 'SAUCE BOLOGNAISE MIJOTÉE AUX TOMATES, A LA VIANDE PUR BŒUF HALAL ET AUX OIGNONS ET AVEC UNE POINTE DE BASILIC (53%): Tomates et jus de tomates 20,3% viande hachée de bœuf* halal 16,7%, oignons 14,2%, conservateurs: E326 et E261 sucre, sel, ail, basilic déshydraté 0,2%, poivre, acidifiant : acide citrique E330. PÂTES CUISINÉES &quot;AL DENTE&quot; (47%): pâtes (semoule de blé dur (contient du gluten), eau, huile végétale de tournesol, sel.', 'https://static.openfoodfacts.org/images/products/351/269/000/2198/front_fr.4.400.jpg', '4.4', '1.2', '18', '3.8', '', '5.7', '0.65', '0.255905511811024', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3512690002204', 'Poulet Tandoori Riz Basmati', 'Emincés de filets de poulet Halal cuisinés avec une sauce mijotée à la crème fraîche, aux oignons et aux épices Tandoori (53%) : _crème fraîche_ 41,3%, filets de poulet halal cuit standard 31,5% (filet de poulet halal 87%, eau, sel, _lactose_, sirop de glucose, stabilisants : E451 - E452, conservateur : E250, arômes (_soja_), saccharose, antioxydant : E301), oignons cuisinés 24,7% ; (oignons, huile de tournesol), épices tandoori 0,7% (épices et aromates contenant du _gluten_, de la _moutarde_ et des _sulfites_, sucres : saccharose - lactose, sel, colorants : poudre de betterave - oléorésine de paprika, maltodextrine, aciditiant : acide citrique, arôme, extraits d\'épices), sel, paprika, piment fort, acidifiants : lactate de potassium et di-acétate de sodium. Riz Basmati cuisiné (47%) : eau, riz Basmati, huile de tournesol, sel.', 'https://static.openfoodfacts.org/images/products/351/269/000/2204/front_fr.6.400.jpg', '5.8', '3.1', '15', '1.1', '', '4.8', '0.47', '0.18503937007874', '', '1');

